Losers, The (2010)  

Verenigde Staten
Actie / Avontuur
98 minuten

geregisseerd door Sylvain White
met Jeffrey Dean Morgan, Chris Evans en Zoe Saldana

De leden van een CIA Black Operation team zijn in de Boliviaanse jungle op een 'search and destroy'-missie. Het team wordt echter verraden en voor dood achtergelaten. Ze besluiten achter de verantwoordelijken aan te gaan om wraak te nemen.

